import React from "react";
import { Link } from "react-router-dom";
import {
  Wrapper,
  StyledSection,
  StyledParagraph,
} from "../../components/Wrapper/styles";

export const LoginScreen = () => {
  return (
    <Wrapper>
      <StyledSection>
        <StyledParagraph>
          <p style={{ textAlign: "center", padding: "12px" }}>
            Log in to the blog
          </p>
        </StyledParagraph>
        <input type="email" />
        <input type="password" />
        <button>
          <Link to="/main">Go </Link>
        </button>
      </StyledSection>

      <StyledSection>
        <StyledParagraph>Go to blog without logging in</StyledParagraph>
        <button>
          <Link to="/main">Go without</Link>
        </button>
      </StyledSection>
    </Wrapper>
  );
};
